import "./Home.css";
const Home = () => {
  return (
    <>
      <img
        className="back"
        style={{ width: "100vw" }}
        src="./images/poster-min.jpg"
        alt=""
      />
      <div className="back-text">
        <img className="back-img" src="./images/back-text.png" alt="" />
        <button onclick="myfunction()" id="play">
          Play <i class="fas fa-play"></i>
        </button>
      </div>
    </>
  );
};

export default Home;
